import { Router, Switch, Route } from 'react-router-dom';
import App from '../../App';

const Header = () => {
	return (
		<header className='header'>
			<div className='header-grid'>
				<div className='header__left'></div>
				<Router>
					<Navbar />

					<Switch>
						<Route path='/' element={App} />
						<Route path='/' element={App} />
					</Switch>
				</Router>
			</div>
		</header>
	);
};

export default Header;
